import React from 'react';

const Filters = ({setMinPriceHandler, setMaxPriceHandler, minPrice, maxPrice}) => {
    return (
        <form action="">

            <label htmlFor="minPrice" id="minPrice" name="minPrice">Price(min):</label>
            <input type="text" id="minPrice" name="minPrice"
            defaultValue={0}
            value={minPrice}
            onChange={(e)=>setMinPriceHandler(e)}
            />

            <label htmlFor="maxPrice" id="maxPrice" name="maxPrice">Price(max):</label>
            <input type="text" id="maxPrice" name="maxPrice"
            value={maxPrice}
            onChange={(e)=>setMaxPriceHandler(e)}
            />

        </form>
    )
}

export default Filters;
